import React, { Component } from "react";
import ReactDOM from 'react-dom';
import { withRouter } from "react-router-dom";
import Bootstrap from '../../.././node_modules/bootstrap/dist/css/bootstrap.min.css';

class Home extends Component {

  handleSubmit = (event) => {
      event.preventDefault();

      return this.props.history.push('/sign-in');

  }
  render(){
    return(
      <div style={{backgroundColor: '#febf63', height: '400px'}} className='container'>
        <div className='row'>
          <div className='col-2'>
          <form onSubmit={this.handleSubmit} noValidate>
            <div style={{backgroundColor: 'black'}} class="btn-group-vertical" role="group" aria-label="Basic example">
              <button style={{color: '#febf63', marginTop: '5px'}} type="button" class="btn btn-primary btn-lg">Profile</button>
              <button style={{color: '#febf63', marginTop: '5px'}} type="button" class="btn btn-primary btn-lg">Classes</button>
              <button style={{color: '#febf63', marginTop: '5px'}} type="button" class="btn btn-primary btn-lg">Chat</button>
              <button style={{color: '#febf63', marginTop: '5px'}} type="button" class="btn btn-primary btn-lg">Email</button>
              <button style={{color: '#febf63', marginTop: '5px'}} type="button" class="btn btn-primary btn-lg">Settings</button>
              <button style={{color: '#febf63', marginTop: '5px'}} type="submit" class="btn btn-primary btn-lg">Log out</button>
            </div>
            </form>
          </div>
          <div className='col-8 back'>
          </div>
          <div className='col-2'>
          </div>
        </div>
      </div>
    )

  }
}

export default withRouter(Home);
